import React, { useState } from 'react';
import styled from "styled-components";

const FormContainer = styled.div`
  width: 100%;
  height: auto;
  padding: 20px;
  background-color: #333333;
  color: white;
  font-family: 'Courier New', monospace;
`;

const StyledInput = styled.input`
  width: 100%;
  padding: 12px 20px;
  margin: 8px 0;
  box-sizing: border-box;
  background-color: #f8f8f8;
`;

const StyledButton = styled.input`
  width: 150px;
  height: 45px;
  margin: 10px;
  border: none;
  background-color: crimson;
  color: white;
  border-radius: 8px;
  font-size: 20px;
  cursor: pointer;
`;

const StyledForm = styled.form`
  display: flex;
  flex-direction: column;
  align-items: center;
`;

function FormViagem({ addViagem }) {
    const [origem, setOrigem] = useState('');
    const [destino, setDestino] = useState('');
    const [duracao, setDuracao] = useState('');
    const [deadline, setDeadline] = useState('');

    const handleAddViagem = (event) => {
        event.preventDefault();
        addViagem(origem, destino, duracao, deadline);
        setOrigem('');
        setDestino('');
        setDuracao('');
        setDeadline('');
    }

    return (
        <FormContainer>
            <StyledForm onSubmit={handleAddViagem}>
                <label>
                    Origem:
                    <StyledInput type="text" value={origem} onChange={e => setOrigem(e.target.value)} />
                </label>
                <label>
                    Destino:
                    <StyledInput type="text" value={destino} onChange={e => setDestino(e.target.value)} />
                </label>
                <label>
                    Duração:
                    <StyledInput type="text" value={duracao} onChange={e => setDuracao(e.target.value)} />
                </label>
                <label>
                    Deadline:
                    <StyledInput type="date" value={deadline} onChange={e => setDeadline(e.target.value)} />
                </label>
                <StyledButton type="submit" value="Adicionar Viagem" />
            </StyledForm>
        </FormContainer>
    );
}

export default FormViagem;
